import React from 'react';

const Header = () => {
    return (
        <div>
            <div class="row">
                <div class="col-lg-2">
                   AESOP
                </div>
                <div class="col-lg-4">
                   HELLO
                </div>
                <div className='col-lg-6'>
                   ANUSH
                </div>
            </div>
        </div>
    )
}

export default Header;
